import React from 'react';
import './Projects.css';

const Projects = () => {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <ul>
        <li>
          <strong>Adaa Jaipur:</strong> 
          Full E-commerce Fashion Website using MERN Stack.
        </li>
        <li>
          <strong>MyStock Website:</strong> 
          MERN stack based stock site.
        </li>
        <li>
          <strong>Automatic Shopping Trolley (IoT):</strong> 
          RFID-based billing, stock management, multilingual support.
        </li>
        <li>
          <strong>Sentiment Analysis for Product Reviews:</strong> 
          NLP with SVM, Voting Classifier.
        </li>
      </ul>
    </section>
  );
};

export default Projects;
